style.css:
@-moz-document domain("spotify.com") {
/* Set the background image */
    body {
        background: url('https://ph.pinterest.com/pin/190488259233341396/') no-repeat center center fixed;
        background-size: cover;
    }

    /* Optional: Adjust the opacity of the sidebar for better visibility */
    .Root__top-container {
        background-color: rgba(255, 255, 255, 0.5) !important;
    }

    /* Customize the colors for various UI elements */
    .main-rt {
        background-color: rgba(255, 255, 255, 0.3) !important;
    }

    .main-rt, .Root__main-view {
        color: #f0f0f0 !important;
    }

    /* Customize the color of active elements */
    .now-playing-bar, .tracklist {
        background-color: rgba(255, 255, 255, 0.2) !important;
    }

    /* Make the text more readable */
    .TrackList-item {
        color: #e0e0e0 !important;
    }

    .playlist-header, .tracklist-header {
        color: #d0d0d0 !important;
    }
}
